import React from 'react'
import { Redirect } from 'react-router-dom'
import { getTokenClient } from './token';

class Main extends React.Component{
    render(){
        if(getTokenClient()){
            return(
                <div>
                    <h2>Bank Dashboard</h2>
    
                </div>
            )
        }
        if(!getTokenClient()){
            return (
                <Redirect to='/login' />
            )    
        }
       
    }
}

export default Main;
